import React from 'react';
import { Box, Input, TextField, Button } from '@mui/material';
import { useForm } from "react-hook-form";
const Login = () => {
    const { register, handleSubmit, watch, formState: { errors } } = useForm();
    const onSubmit = (data) => {
        console.log(data)
    }

    return (
        <Box className="LoginForm">
            <Box className="Form1">
                <form onSubmit={handleSubmit(onSubmit)}>
                    <TextField
                        id="standard-basic"
                        label="Outlined"
                        variant="outlined"
                        className="inputLogin"
                        defaultValue="test" {...register("example")}
                    />
                    <TextField
                        id="standard-basic"
                        label="Outlined"
                        variant="outlined"
                        className="inputLogin"
                    />
                    <Button
                        variant="contained"
                        className="buttonLogin"
                        >Contained
                    </Button>
               </form>  
            </Box>
            <Box className="Form2">

            </Box>
        </Box>
    )
};

export default Login;
